import React from "react";
import styled from "styled-components";
import Page from "../../global/Page";
import AboutAccents from "./components/AboutAccents";
const About = () => {
    return (
        <Page>
            <AboutAccents />
            <Team>
                <div className='blurb'>
                    <Profile1 className='profile-img'>
                        <div className='bg' />
                        <div className='accent' />
                    </Profile1>
                    <div className='name'>Kelvin de Los Angeles</div>
                    <div className='icon'></div>
                    <div className='bio'>
                        Lorem ipsum dolor sit amet consectetur, adipisicing elit. Maiores obcaecati ratione perferendis modi omnis cupiditate tempore.
                        Perferendis ratione aliquam adipisci. Quisquam, inventore! Natus consectetur temporibus ex qui? Dolores, doloremque. Provident
                        fugiat, id voluptas repudiandae incidunt nisi saepe eos esse dicta.
                    </div>
                </div>
            </Team>
        </Page>
    );
};
const Team = styled.div`
    .blurb {
        display: grid;
        grid-template-columns: repeat(2, min-content);
        grid-template-areas:
            "img img"
            "name icon"
            "bio bio";
    }
    .profile-img {
        grid-area: img;
    }
    .name {
        grid-area: name;
    }
    .icon {
        grid-area: icon;
    }
    .bio {
        grid-area: bio;
    }
`;

const Profile1 = styled.div`
    display: relative;
    height: 199px;
    width: 199px;
    background-color: tomato;
    .bg {
        /* background-image: url() */
    }
    .accent {
        background-color: green;
    }
`;

export default About;
